import React, { useState } from "react";
import { Button } from "@material-ui/core";
const Search = ({ handleNewSearch }) => {
  const [searchText, setSearchText] = useState("");

  return (
    <div className="search">
      <input
        style={{ flex: 1, margin: "0 20px 0 0", color: "white" }}
        placeholder="Search for News Stories"
        onChange={(e) => setSearchText(e.target.value)}
      />
      {/* <input onChange={(e) => setSearchText(e.target.value)}></input> */}
      <Button
        variant="contained"
        color="primary"
        onClick={() => handleNewSearch(searchText.toLowerCase())}
      >
        Search
      </Button>
    </div>
  );
};

export default Search;
